import Layout from "../components/Layout";

class Retrive extends React.Component {
  constructor() {
    super();
    this.state = {
      songs: []
    };
  }

  async componentWillMount() {
    await fetch("/api")
      .then(response => response.json()) // changes into javscript object
      .then(data => {
        this.setState({
          character: data,
          isLoading: false
        });
      });
  }

  render() {
    return (
      <Layout>
        <div>
          <h1>Data from the Mongo DB Database (WIP)</h1>
          <p>Storing song_name and score ... </p>
        </div>
      </Layout>
    );
  }
}

export default Retrive;
